  - [ ] it has been reviewed by a DefinitelyTyped member.

Uses [discriminated union types](https://github.com/Microsoft/TypeScript/pull/9163) to allow type narrowing based on string literal comparisons on the `type` field. This makes ESTree much more natural to use, with fewer casts needed.

For example:

``` typescript
let node: ESTree.Node;
let identifier: ESTree.Identifier;
if (node.type === 'Identifier') {
  identifier = node;  // succeeds with this PR!
}
```
